//JavaScript


const getAlertConfig = (typeId) => {
    let alertConfig;
    if (datasources.getAlertConfigurations.latestData()) {
        alertConfig = datasources.getAlertConfigurations.latestData().results.payload.DATA.find(
            (data) => data.item_id === typeId
        )
    }
    return alertConfig || {}
}

const listGroup = $('#alerts .list-group');
const handleAlerts = (data) => {
    const alerts = data.results.payload.DATA.filter((alert) => {
        if (!alert.snoozed_date) return true
        return +new Date() > +new Date(alert.snoozed_date)
    })
    listGroup.empty();

    if (alerts.length === 0) {
        listGroup.append('No active alerts')
    } else {
        alerts.forEach((a) => {
            const item = $('<button class="alert-item list-group-item list-group-item-action"></button>')
            const itemDesc = $('<span></span>');
            const alertType = getAlertConfig(a.configuration_id)
            itemDesc.html(`
            <div class="message">
                <span><i class="warning fa fa-exclamation-triangle" aria-hidden="true"></i></span>
                ${alertType.message || ''}</div>
            <div class="text-muted">${AlertConfigSummary(alertType) || ''}</div>
            `)
            const itemTime = $('<span></span>');
            itemTime.css({
                'font-size': '.75rem'
            })
            let time = a.sent_date;
            try {
                time = new Date(time).toLocaleString()
            } catch (e) {
                console.warn('Unable to parse time', e);
            }
            const itemButtons = `<div class="alert-buttons">
            <button class="btn btn-outline-warning btn-sm alert-action-btn snooze-alert d-float" data-snoozed-count=${a.snoozed_count} data-item-id=${a.item_id}>Snooze</button>
            <button class="alert-action-btn btn btn-outline-success btn-sm acknowledge-alert" data-item-id=${a.item_id}>Acknowledge</button>
        </div>`
            item.append(itemButtons);

            item.append(itemDesc);
            item.append(`<div>${time}</div>`);
            listGroup.append(item);
        })
    }
}

if (!window.hasSubscribedToAlerts) {
    window.hasSubscribedToAlerts = true;
    datasources.getAlerts.latestData.subscribe(handleAlerts);

}

if (datasources.getAlerts.lastUpdated) {
    handleAlerts(datasources.getAlerts.latestData());
}

if (!window.setupAlertListeners) {
    window.setupAlertListeners = true;
    $('body').on('click', '.acknowledge-alert', (e) => {
        datasources.updateAlert.sendData({
            item_id: e.target.dataset.itemId,
            alert: {
                is_active: false,
                acknowledge_date: (new Date()).toISOString()
            }
        }).then(() => {
            datasources.getAlerts.sendData();
        })
    })

    $('body').on('click', '.snooze-alert', (e) => {
        datasources.updateAlert.sendData({
            item_id: e.target.dataset.itemId,
            alert: {
                snoozed_count: Number(e.target.dataset.snoozedCount) + 1,
                // 30 min from now
                snoozed_date: (new Date(Date.now() + 1000 * 30 * 60)).toISOString()
            }
        }).then(() => {
            datasources.getAlerts.sendData();
        })
    })
}

function AlertConfigSummary(alertConfig) {
    if (!datasources.getSensors.latestData() || !datasources.getSensorTypes.latestData()) return ''
    const rules = tryParse(alertConfig.rules)
    let text = rules && rules.map((rule) => RuleSummary(rule)).join(' and ')
    if(alertConfig.timeout) {
        text = text + ` for ${alertConfig.timeout} minutes`
    }
    return text
}

function RuleSummary(rule = {}) {
    const sensor = datasources.getSensors.latestData().results.payload.DATA.find((s) => s.sensor_id === rule.sensor_id) || {}
    const sensorType = datasources.getSensorTypes.latestData().results.payload.DATA.find((s) => s.item_id === sensor.sensor_type_id) || {}

    const propertyStr = rule.property === 'battery_level' ? 'Battery' : sensorType.display_name
    const wordsFromOp = {
        'GT': 'is above',
        'LT': 'is below',
        'EQ': 'is equal',
    }
    const operatorStr = (sensorType.data_type === 'int' || rule.property === 'battery_level') ? wordsFromOp[rule.operator] : ''
    const valueStr = (sensorType.data_type === 'int' || rule.property === 'battery_level') ? rule.value : (rule.value ? 'is open' : 'is closed')
    const attributeStr = rule.property === 'battery_level' ? 'percent' : sensorType.attributes
    return `"${sensor.sensor_label}" ${propertyStr && propertyStr.toLowerCase()} ${operatorStr} ${valueStr} ${attributeStr && attributeStr.toLowerCase()}`
}

function tryParse(str) {
    try {
        return JSON.parse(str)
    } catch(e) {
        console.warn(e, str)
    }
}

