const buildTable = (sensors) => {
    const myContainer = $('#statis_tble');
    const table = $('<table></table>');
    const tHead = $('<thead></thead>');
    const tHeadRow = $('<tr></tr>');
    const tBody = $('<tbody></tbody>');

    columns.forEach((c) => {
        const tHeadColumn = $('<th scope="col"></th>');
        tHeadColumn.html(c.label);
        tHeadRow.append(tHeadColumn);
    })

    tHead.append(tHeadRow);
    table.append(tHead);
    table.append(tBody);

    sensors.forEach((s) => {
        const tBodyRow = $('<tr></tr>');
        columns.forEach((c) => {
            const td = $('<td></td>');
            const text = c.format ? c.format(s[c.key]) : s[c.key];
                    td.html(text);          
                    tBodyRow.append(td);
        })
        tBody.append(tBodyRow);
    })

    table.addClass('table table-striped')
    myContainer.empty();
    myContainer.append(table);
}

