      // contact_method: $("input[name='contactMethod']:checked").val(),
      rules: JSON.stringify(rulesList),
    }

    if (e.target.textContent === 'Update') {
      datasources.updateAlertConfiguration.sendData({ item_id: $("#item-id").val(), alertConfiguration }).then(() => {
        updateAlertConfigs()
      })
    } else {
      datasources.createAlertConfiguration.sendData({ alertConfiguration }).then(() => {
        updateAlertConfigs()
      })
    }
  })

