function getBase64(file) {
    if (file) {
       return new Promise((resolve, reject) => {
            const reader = new FileReader();
            reader.readAsDataURL(file);
            reader.onload = () => resolve(reader.result);
            reader.onerror = error => reject(error);
        }); 
    } else {
        const currentType = datasources.getFoodTestTypes.latestData().results.payload.DATA.find(l => l.item_id === datasources.currentFoodTestType.latestData()) 
        return new Promise((resolve, reject) => {
            if (currentType) {
                resolve(currentType.icon);
            } else {
                resolve('');
            }
        });
    }
};

