const getWidthPercentForSensors = (count) => {
    if (count === 1) {
        return '100';
    } else if (count === 2) {
        return '50';
    } else if (count === 3) {
        return '33';
    } else if (count >= 4) {
        return '50';
    }
    return '100';
}

