const addInfoToGauge = (sensorInfo) => {
    try {
        const sensorElem = $(`#sensors-form .field-${sensorInfo.id} .row`);
        sensorElem.off('click');
        sensorElem.on('click', () => {
            datasources.currentSensorGauge.sendData(sensorInfo);
        })
        sensorElem.addClass('c-pointer')
        sensorElem.find('.message-time').remove();
        const msgTime = messageTimeElem(sensorInfo);
        replaceLabel(sensorElem, sensorInfo);
        sensorElem.append(msgTime);
    } catch (e) {
        console.warn('Unable to append time to sensor gauge', e, sensorInfo);
    }
