const buildFieldForSensor = (sensorInfo, widthPercent) => {
    const name = sensorInfo.id;
    switch (sensorInfo.sensorType.data_type) {
        case 'int':
            const progressColor = window.getFillColorForSensor(sensorInfo.alertConfig, window.parseDataFromSensor(sensorInfo));
            const units = getUnitsForSensor(sensorInfo);
            setTimeout(() => {
                addInfoToGauge(sensorInfo);
            }, 1500);
            return {
                orderIdx: 1, name, dataType: 'number', display: true, key: sensorInfo.id, inputType: 'RADIAL_GAUGE', widthPercent, progressColor, units
            }
        case 'bool':
            return {
                orderIdx: 0, name, dataType: 'bool', display: true, key: sensorInfo.id, widthPercent, inputType: 'HTML', parser: buildBooleanFieldParser(sensorInfo)
            }
