const cmessageReceived = (msg) => {
    let parsedMsg;
    try {
        parsedMsg = JSON.parse(msg);
    } catch (e) {
        console.error('Failed to parse message', e);
    }
    if (parsedMsg && parsedMsg.sensor_message.sensorID) {
        try {
            const id = parsedMsg.sensor_message.sensorID;
            const sensor = cgetSensorById(id);
            const sensorType = cgetSensorTypeById(datasources.getSensorTypes.latestData().results.payload.DATA, sensor.sensor_type_id);
            const alertConfig = getAlertConfigForSensorById(id);
            
            datasources.testDatasourceSensors.sendData({
                ...datasources.testDatasourceSensors.latestData(),
                [id]: {
                    id,
                    sensorType,
                    sensor,
                    message: parsedMsg,
                    alertConfig
                }
            })
        } catch (e) {
            console.error('Unable to update testDatasourceSensors', id, sensorType, sensor, e)
        }
    }
}

const csetupMessaging = () => {
    return new Promise((resolve) => {
        if (!window.messagingObjectForSensors) {
            window.sensorSubscriptions = [];
            window.messagingObjectForSensors = CB_PORTAL.ClearBlade.Messaging({ useSSL: true }, resolve);
        } else {
            window.sensorSubscriptions.forEach((sub) => {
                try {
                    window.messagingObjectForSensors.unsubscribe(sub.topic, {});
                } catch (e) {
                    console.error('Unable to unsub from topics', e);
                }
            })

            window.sensorSubscriptions = [];
            resolve();
        }
    })
}

