const columns = [{key: 'sensor_id', label: 'Sensor ID'}, {key: 'sensor_name', label: 'Sensor Name'}, {key: 'latest_payload', label: 'Current Reading'}, {key: 'battery_level', label: 'BatteryLevel'}, {key: 'signal_strength', label: 'SignalStrength'}, 
{key: 'last_active', label: 'Reading On', format: (date) => {
    try {
        return new Date(date).toLocaleString();
    } catch(e) {
        return date;
    }

}}]

const buildTable = (sensors) => {
    const myContainer = $('#sensor-table-container');
    const table = $('<table></table>');
    const tHead = $('<thead></thead>');
    const tHeadRow = $('<tr></tr>');
    const tBody = $('<tbody></tbody>');

    columns.forEach((c) => {
        const tHeadColumn = $('<th scope="col"></th>');
        tHeadColumn.html(c.label);
        tHeadRow.append(tHeadColumn);
    })

    tHead.append(tHeadRow);
    table.append(tHead);
    table.append(tBody);

    sensors.forEach((s) => {
        const tBodyRow = $('<tr></tr>');
        columns.forEach((c) => {
            const td = $('<td></td>');
            const text = c.format ? c.format(s[c.key]) : s[c.key];
            if(c.key=="battery_level"){
  if (text >= 50 && text <= 100) {

  td.append("<i class='fa fa-battery-full' style='font-size:18px;color:green'></i><br/>" +text + "%");
 } else if (text >= 26 && text <= 49) {
  td.append("<i class='fa fa-battery-half' style='font-size:18px;color:amber'></i><br/>" + text + "%");
} else if (text >= 1 && text <= 25) {
  td.append("<i class='fa fa-battery-quarter' style='font-size:18px;color:red'></i><br/>" + text+ "%");
  } else {
 td.append("<i class='fa fa-battery-empty' style='font-size:18px;color:red'></i><br/>" + text + "%");
  }


    }else if(c.key=="signal_strength"){

          if (text >= 50 && text <= 100) {
  td.append("<i class='fa fa-signal' style='font-size:18px;color:green'></i><br/>" +text + "%");
 } else if (text >= 26 && text <= 49) {
 td.append("<i class='fa fa-signal' style='font-size:18px;color:#FFC200'></i><br/>" + text + "%");
} else if (text >= 1 && text <= 25) {
  td.append("<i class='fa fa-signal' style='font-size:18px;color:red'></i><br/>" + text+ "%");
  } else {
  td.append("<i class='fa fa-signal' style='font-size:18px;color:black'></i><br/>" + text + "%");
  }

            }
            else{
                td.html(text);
            }

            tBodyRow.append(td);
        })
        tBody.append(tBodyRow);
    })

    table.addClass('table table-striped')
    myContainer.empty();
    myContainer.append(table);
}

const handleSensors = (data) => {
    console.log('handle', data);
    buildTable(data.results.payload.DATA);
}

