const ruleOperators = {
    GT: 'GT',
    LT: 'LT',
    EQ: 'EQ'
}

const filterRulesBySensorId = (rules, id) => {
    try {
        for (let i = 0, len = rules.length; i < len; i++) {
            if (rules[i].sensor_id === id) {
                return rules[i];
            }
        }
    } catch (e) {
        return;
    }
}

window.getRuleForSensorById = (alertConfigs, id) => {
    try {
        for (let i = 0, len = alertConfigs.length; i < len; i++) {
            const rules = JSON.parse(alertConfigs[i].rules);
            const sensorRules = filterRulesBySensorId(rules, id);
            if (sensorRules) {
                return sensorRules;
            }
        }
    } catch (e) {
        return;
    }
}

window.getAlertConfigForSensorById = (id) => {
    if (datasources.getAlertConfigurations.lastUpdated) {
        try {
            const configs = datasources.getAlertConfigurations.latestData().results.payload.DATA;
            return getRuleForSensorById(configs, id);
        } catch (e) {
            console.warn('Unable to get alert config for sensor with id', id, e);
        }
    }
}

window.doAnySensorsCrossThreshold = (sensors = []) => {
    try {
        for (let i = 0, len = sensors.length; i < len; i++) {
            const rule = window.getAlertConfigForSensorById(sensors[i].sensor_id);
            if (doesSensorCrossThreshold(rule, sensors[i].latest_payload)) {
                return true;
            }
        }
    } catch (e) {
        console.error('Failed to check if sensors cross alert threshold', e);
        return false;
    }
    return false;
}

window.doesSensorCrossThreshold = (rule, value) => {
    if (rule) {
        try {
            const val = Number(value);
            const ruleThreshold = Number(rule.value);
            let crossedThreshold = false;
            switch (rule.operator) {
                case ruleOperators.GT:
                    crossedThreshold = val > ruleThreshold;
                    break;
                case ruleOperators.LT:
                    crossedThreshold = val < ruleThreshold;
                    break;
                case ruleOperators.EQ:
                    crossedThreshold = val === ruleThreshold;
                    break;
            }
            return crossedThreshold;
        } catch (e) {
            console.error('Failed to check if sensor crossed threshold', e);
            return false;
        }
    } else {
        return false;
    }
}


window.getFillColorForSensor = (rule, value) => {
    if (rule) {
        try {
            return doesSensorCrossThreshold(rule, value) ? 'red' : 'green';
        } catch (e) {
            console.warn('Unable to get fill color for sensor', rule, value, e);
        }
    }
    return 'green';
}

window.parseDataFromSensor = (sensorInfo) => {
    switch (sensorInfo.sensorType.data_type) {
        case 'int':
            if (sensorInfo.message.sensor_message.dataType === "Percentage|TemperatureData") {
                return Number(sensorInfo.message.sensor_message.dataValue.split('|')[0])
            } else {
                return Number(sensorInfo.message.sensor_message.dataValue)
            }
        case 'bool':
            return sensorInfo.message.sensor_message.dataValue === 'True' ? true : false;
    }
}

window.tryAgain = (checkFn, callback, timeout, maxTries) => {
    let numOfTries = 0;
    const innerTry = () => {
        console.log('trying', numOfTries);
        if (checkFn()) {
            callback();
        } else if (numOfTries < maxTries) {
            numOfTries++;
            setTimeout(innerTry, timeout);
        } else {
            console.error('reached max number of tries');
        }
    }
    innerTry();
}

