//JavaScript


const cgetSensorTypeById = (types, id) => {
    return types.filter((t) => t.item_id === id)[0];
}

const cgetSensorSubscription = (topic) => {
    return window.sensorSubscriptions.filter((sub) => sub.topic === topic)[0];
}
const cgetLabelForSensor = (sensorMsg) => {
    try {
        if (datasources.getSensors.lastUpdated) {
            const sensors = datasources.getSensors.latestData().results.payload.DATA;
            for (let i = 0, len = sensors.length; i < len; i++) {
                if (sensors[i].sensor_id === sensorMsg.sensorID) {
                    return sensors[i].sensor_label;
                }
            }
        }
    } catch (e) {

    }
    return sensorMsg.sensorName;
}

const cgetSensorById = (id) => {
    const sensors = datasources.getSensors.latestData().results.payload.DATA;
    for (let i = 0, len = sensors.length; i < len; i++) {
        if (sensors[i].sensor_id === id) {
            return sensors[i];
        }
    }
}

const cmessageReceived = (msg) => {
    let parsedMsg;
    try {
        parsedMsg = JSON.parse(msg);
    } catch (e) {
        console.error('Failed to parse message', e);
    }
    if (parsedMsg && parsedMsg.sensor_message.sensorID) {
        try {
            const id = parsedMsg.sensor_message.sensorID;
            const sensor = cgetSensorById(id);
            const sensorType = cgetSensorTypeById(datasources.getSensorTypes.latestData().results.payload.DATA, sensor.sensor_type_id);
            const alertConfig = getAlertConfigForSensorById(id);

            datasources.testDatasourceSensors.sendData({
                ...datasources.testDatasourceSensors.latestData(),
                [id]: {
                    id,
                    sensorType,
                    sensor,
                    message: parsedMsg,
                    alertConfig
                }
            })
        } catch (e) {
            console.error('Unable to update testDatasourceSensors', id, sensorType, sensor, e)
        }
    }
}

const csetupMessaging = () => {
    return new Promise((resolve) => {
        if (!window.messagingObjectForSensors) {
            window.sensorSubscriptions = [];
            window.messagingObjectForSensors = CB_PORTAL.ClearBlade.Messaging({ useSSL: true }, resolve);
        } else {
            window.sensorSubscriptions.forEach((sub) => {
                try {
                    window.messagingObjectForSensors.unsubscribe(sub.topic, {});
                } catch (e) {
                    console.error('Unable to unsub from topics', e);
                }
            })

            window.sensorSubscriptions = [];
            resolve();
        }
    })
}

const cmessageHistoryCallback = (err, data) => {
    if (!err) {
        if (data && data[0]) {
            cmessageReceived(data[0].message);
        }
    }
}

const cresetGauges = () => {
    datasources.testDatasourceSensors.sendData({});
}

const cupdateGauges = (sensors) => {
    cresetGauges();

    sensors.forEach((s) => {
        const sensorType = cgetSensorTypeById(datasources.getSensorTypes.latestData().results.payload.DATA, s.sensor_type_id);
        const topicName = `monnit-webhook-adapter/${s.sensor_id}`;

        window.sensorSubscriptions.push({ topic: topicName });
        window.messagingObjectForSensors.subscribe(topicName, {}, cmessageReceived);
        CB_PORTAL.ClearBlade.MessagingStats().getMessageHistory(topicName, new Date().getTime(), 1, cmessageHistoryCallback)
    })
}
function cfilterSensors(data)
{
    let sensors;
    let probType="4ebd356c-b35d-4b7d-a2be-2b6854973057";
    try {
        sensors = data.sensors;
        sensors = sensors.filter((s)=>s.sensor_type_id != probType);
        //let sensorsAry=sensors.map((sensor)=>{if(sensor.sensor_type_id != probType) return sensor});
       // sensors=sensorsAry;
       console.log(sensors);
    } catch (e) {
        console.error('error parsing sensors after selecting asset', e);
    }
    if (sensors && Array.isArray(sensors)) {

        // update the history line chart
        try {
            datasources.sensorHistoryIds.sendData(sensors.map((s) => s.sensor_id))
            if (datasources.sensorHistoryTimeRange.lastUpdated) {
                const timeRange = datasources.sensorHistoryTimeRange.latestData();
                datasources.getHistoryForSensors.sendData({
                    sensor_ids: datasources.sensorHistoryIds.latestData(),
                    startTime: timeRange.startDate.toISOString(),
                    endTime: timeRange.endDate.toISOString()
                })
            }
        } catch (e) {
            console.error('error parsing sensors after selecting asset', e);
        }
        csetupMessaging().then(() => {
            // update the 'latest data' gauges
            try {
                cupdateGauges(sensors);
            } catch (e) {
                console.error('error updating gauges', e);
            }
        })
    }
}
